import React from "react";
import { FormItemPaymentFinal } from "../../Shared/Input";
import { ButtonCheck } from "../../Shared/Button";
import { ConfigProvider, Form } from "antd";
import { validateMessages } from "../../../Message";

export const DeliverForm = ({ onFinish, loading, initialValues }) => {
  return (
    <ConfigProvider form={{ validateMessages }}>
      <Form name="deliver" onFinish={onFinish} initialValues={initialValues}>
        <FormItemPaymentFinal />
        <ButtonCheck type="primary" htmlType="submit" loading={loading} />
      </Form>
    </ConfigProvider>
  );
};
